<form class="chat-input" (submit)="sendMessage($event)" role="form" aria-label="Send a new message to the chatbot">
  <!-- Message Input Field -->
  <input type="text" class="chat-input__field" [value]="message()" (input)="updateMessage($event)"
    [disabled]="isMessageSending()" placeholder="{{'general.typeYourMessage' | translate}}" appAutoFocus
    aria-label="Message input field" aria-controls="chat-messages-list" required />

  <!-- File Attachment Button and Hidden Input -->
  <!-- <label for="chat-input__file-upload" class="chat-input__attach-button" tabindex="0" role="button"
    aria-label="Attach files to message">
    <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
      <path
        d="M12 2C6.48 2 2 6.48 2 12C2 17.52 6.48 22 12 22C17.52 22 22 17.52 22 12C22 6.48 17.52 2 12 2ZM17 13H13V17H11V13H7V11H11V7H13V11H17V13Z"
        fill="#A3ADBB" />
    </svg>
    <input id="chat-input__file-upload" type="file" multiple (change)="onFileSelected($event)"
      class="chat-input__file-input-hidden" aria-hidden="true" tabindex="-1" />
  </label> -->

  <!-- Display Selected Files -->
  @if (selectedFiles().length > 0) {
  <div class="chat-input__file-preview" role="status" aria-live="polite">
    <ul class="chat-input__file-list">
      @for (file of selectedFiles(); track file.name) {
      <li class="chat-input__file-list-item">
        <span class="chat-input__file-name">{{ file.name }}</span>
        <span class="chat-input__file-size"> ({{ (file.size / 1024 / 1024).toFixed(2) }} MB)</span>
      </li>
      }
    </ul>
    <button type="button" class="chat-input__clear-files-button" (click)="clearFiles()"
      aria-label="Clear all attached files">
      <svg width="18" height="18" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path
          d="M19 6.41L17.59 5L12 10.59L6.41 5L5 6.41L10.59 12L5 17.59L6.41 19L12 13.41L17.59 19L19 17.59L13.41 12L19 6.41Z"
          fill="#F44336" />
      </svg>
    </button>
  </div>
  }
